import React, { useState, Component } from 'react';
import ReactMapGL, {Marker} from 'react-map-gl';
import * as plantData from '../data/plants.json'
require('dotenv').config();

class Map extends Component {
    state = { 
        target_date: Date.parse('01/01/1900'),
        viewport: {
            width: "100vw",
            height: "80vh",
            latitude: 37.7577,
            longitude: -122.4376,
            zoom: 8
          }
     }

    render() { 
        return (
            <div>
                <ReactMapGL
                    {...this.state.viewport}
                    mapboxApiAccessToken = {process.env.REACT_APP_MAPBOX_TOKEN}
                    onViewportChange={(viewport) => this.setState({viewport})}
                >   
                {plantData.plants.forEach(plant=>{
                    var date = Date.parse(plant.accessDate);
                    if(date > this.state.target_date){
                        <Marker key = {plant.occid}
                                latitude={plant.decimalLatitude}
                                longitude={plant.decimalLongitude}
                        >   
                        <div>Here</div>
                        </Marker>
                    }
                })
                }
                </ReactMapGL>
            </div>
        )
    }
}

export default Map;
